import React from 'react';

// import children components
import TiktokOrgPost from './TiktokOrgPost';

//import database
import { tiktok_info } from "../data/tiktok";


const Tiktok = () => {
  return (
    <div className='tiktok-wrapper'>
        <h1>TikTok</h1>

        <section>

            <h2>TikTok Organizer</h2>

            {tiktok_info.map((item, index) => {
            return <TiktokOrgPost title={item.title} audio={item.audio} />;
          })}
            <h3>Post Title: </h3>

        </section>

        <section>
            <h2>TikTok Visualizer</h2>
        </section>

    </div>
  )
}

export default Tiktok;
